#funcao com condições para mostrar valor absoluto de um numero

def abs_val(num):  
  if num < 0:
    return -num
  if num == 0:
    return 0
  else:
    return num

saida = abs_val(-4)
print(saida)

saida = abs_val(0)
print(saida)

saida = abs_val(78.3)
print(saida)

