"""### Função recursiva
###### Esse tipo de função chama ela mesma no corpo da função.A execução requer a aplicação da função de novo. A função recursiva divide um problema em partes menores ou subproblemas.
"""

#funcao para calculo de fatorial
#retorna o fatorial de um nro positivo n

def factorial(n):
  if n == 1:  #caso base
    return 1
  else:
    return n * factorial(n - 1) #caso recursivo

fat = factorial(8)  #variavel recebe resultado da funcao chamada para calculo 
print(fat)  #imprime o fatorial de 8

#função recursiva para somar dígitos de um numero inteiro positivo

def som_digitos(n):
  if n < 10:
    return n
  else:
    todos_mas_ult = n // 10 #resultado da divisao de um nro inteiro com corte dos décimos
    ult = n % 10 
  return som_digitos(todos_mas_ult) + ult

soma = som_digitos(1975)
print(soma)

#funcao apresenta o nro posterior da sequencia de Fibonacci (0, 1 , 2, 3, 5, 8, 13, 21, 34...)
#na sequencia Fibonacci cada numero representa a soma
# dos 2 números anteriores, començando por 0 e 1
def fib(n):
  if n == 1:  #caso base
    return 0
  if n == 2:  #caso base
    return 1
  else:
    return fib(n-1) + fib(n-2)  #caso recursivo

seq = fib(8)
print(seq)

#funcao avalia se a palavra é um palindromo (pode se lida de trás pra frente)

def isPalindrome(s):
  if len(s) <= 1:
    return True
  else:
    return s[0] == s[-1] and isPalindrome(s[1:-1])

word = input("Informe uma palavra e descubra se ela é um palíndromo: ")
if str(word) == str(word)[::-1] :  #usa metodo de fatiamento da lista para reverter a string 
    print("Palindrome")            #compara-se str original com cada elemento da str invertida
else:
    print("Not Palindrome")

word = input("Informe uma palavra e descubra se ela é um palíndromo: ")
if str(word) == str(word)[::-1] :
    print("Palindrome")
else:
    print("Not Palindrome")

#funcao reversed()retorna um iterador reverso para a sequência informada 
word = input("Digite uma palavra e descubra se ela é um palíndromo: ")   
if str(word) == "".join(reversed(word)) :
    print("Palindrome")  
else:   #pode usar reversed() no lugar do índice da lista [::-1]
    print("Not Palindrome")

"""### Programação Orientada a Objetos (POO)

![poo_python.jpg](data:image/jpeg;base64,)

![poo2-python.jpg](data:image/jpeg;base64,)

###### Em Python, objetos incluem listas, tuplas e métodos associados a esses tipos de dados. Programadores podem definir novos objetos; objetos são categorizados para se manterem organizados. A categorização é feita em classes.

![poo4_python.jpg](data:image/jpeg;base64,)
"""

class Cao(): #nomear classe com 1a letra em maiusculo
  def __init__(self, nome, idade):  #inicializa a funcao
    self.nome = nome   #nome é uma variavel input
    self.idade = idade     #idade é uma variavel input
    #self.none e self.idade são atributos ou caracteristicas do objeto
    #self é uma variavel ligada ao objeto Cao
  
  def latir(self):   #definido latir como método ou como o objeto opera/funciona 
    print("Au, au!!")      
    #assim foi criada ou instanciada a classe Cao

doki = Cao("Doki", 8) #criada instancia específica da classe Cao

#chamar o metodo Latir de Doki
doki.latir()   #executa o codigo contido no corpo do metodo

print(doki.nome)
print(doki.idade)

#atualizar o atributo idade do objeto 
doki.idade += 1

print(doki.idade)